    false,nt"url": null,nt"notes": "NCEI Accession 0150695 contains raw underway
    meteorological, navigational, optical, physical and time series data logged by the
    Scientific Computer System (SCS) aboard NOAA Ship Oscar Dyson in the Coastal Waters
    of SE Alaska from 2016-01-30 to 2016-02-01. Office of Marine and Aviation Operations
    (OMAO) personnel aboard the ship submitted these data and associated metadata to
    NCEI. In addition, NCEI Accession 0150695 contains supplementary cruise-level metadata,
    which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NCEI
    personnel developed the automated process to archive these data under the auspices
